      }, []);


    return (

        <div style={{backgroundColor:"rgb(210, 210, 211)",maxWidth:"1300px",paddingBottom:"700px"}}>


        <div className="web" style={{display:"flex", flexDirection:"row",width:"100%"}}>
        <div style={{minWidth:"30%"}}>
        <Question/> 
        <DashSideNav /> 
        </div>
        <div style={{minWidth:"70%"}}>
