        <div className="mobile">
        <div >
        <DashSideNav/> 
        </div>
        <div style={{margin:"0 auto"}} >
        <Question/> 
        {/* <Search /> */}
        <Posts/>
        </div>

        </div>

        </div>
       )
}


export default Home;
